import React from 'react'

export default function CompSheet(props) {
    return (
      <div key={props.id} className="sheet">
          <img src={props.url_img} alt={props.title}/>
          <div className="card-text">
          <h2>{props.title}</h2>
          <p>{props.date}</p>
          <p>{props.description}</p>
          <p>{props.score}</p>
          </div>
      </div>
    );
  }
